(function () {
  'use strict';
	var app = angular.module('MyApp');


	app.controller('modalInstanceController', function ($scope, $modalInstance, optionsModal, $http) {
		$scope.sadImage = 'data:image/gif;base64,';
		$scope.happyImage = 'data:image/gif;base64,';


		$scope._initializeVariables = function () {
			if(optionsModal.typeOfModal === 'info') {
				$scope.modalType = optionsModal.typeOfModal;
				$scope.className = optionsModal.typeOfModal;
				$scope.modalTitle = 'Useful Info';

			} else if (optionsModal.typeOfModal === 'success') {
				$scope.modalType = optionsModal.typeOfModal;
				$scope.className = optionsModal.typeOfModal;
				$scope.modalTitle = 'Success';
				$scope.consoleMsg = optionsModal.consoleMsg;
				$scope.textImage = 'May the Force be with you';
				$scope.gifImage = $scope.happyImage;

			} else if (optionsModal.typeOfModal === 'danger') {
				$scope.modalType = 'error';
				$scope.className = optionsModal.typeOfModal;
				$scope.modalTitle = 'Error';
				$scope.consoleMsg = optionsModal.consoleMsg;
				$scope.textImage = 'Ooouch! Try again!';
				$scope.gifImage = $scope.sadImage;
			}

			$scope.headerClass = 'header-' + $scope.modalType;
			$scope.btnClass = 'btn-' + $scope.modalType;
		};

		$scope._initializeVariables();


		$scope.ok = function () {
			if($scope.modalType === 'success') {
				$http({
					url: 'http://localhost:8085/__admin/mappings/reset',
					method: 'POST',
					headers: {
						'Content-Type': 'application/json'
					},
					data: {
						'hello': 'refreshing mocks'
					}
				});
			}

			$modalInstance.close();
		};
	});

})();
